import React, { Component } from 'react';
import LoginForm from '../components/LoginForm';
import NavBar from '../components/NavBar';

class Login extends Component{
    render(){
        return (
            <div>
                <LoginForm/>
                <NavBar/>
            </div>
        )
    }
}

export default Login;
